import React from "react";

class Experience extends React.Component {
  render() {
    return (
      <div id="experience" style={MainDiv} data-aos="fade-down" data-aos-duration="9000">
        <div style={Heading}>
          <div>Experience</div>
        </div>
        <div
          className="container shadow p-3 mb-5 rounded"
          style={{
            backgroundColor: "#F7F7F7",
            padding: "1%",
            borderRadius: "10px",
          }}
        >
          <div className="row" style={Content}>
            <div className="col-lg-4 col-md-4 col-sm-12" style={WorkExdivs}>
              Exp 1
            </div>
            <div className="col-lg-4 col-md-4 col-sm-12" style={WorkExdivs}>
              Exp 2
            </div>
            <div className="col-lg-4 col-md-4 col-sm-12">Exp 3</div>
          </div>
        </div>
      </div>
    );
  }
}

const MainDiv = {
  marginTop: "70px",
  // height: window.innerHeight,
};

const Heading = {
    justifyContent: "center",
    display: "flex",
    fontWeight: "bold",
    fontSize: "40px",
    fontFamily: "playfair display",
    color: "#193964",
    padding: "3%",
};

const Content = {
  fontWeight: "bold",
  fontSize: "22px",
  fontFamily: "papyrus",
  color: "rgb(68, 68, 68)",
};

const WorkExdivs = {
  borderRight: "1px solid grey",
  height: "400px",
  width: "20px",
};
export default Experience;
